<div id=id-l1section1>
<h2>Setup the lab</h2>
<p><em>Notes</em>: </p>
<ul>
<li>For the lab, it is better to use a laptop or desktop computer instead of a tablet.</li>
<li>The lab uses Amazon Web Services (AWS) which take some time to spin up. You may need to wait a few minutes for the lab to open.</li>
</ul>
